description:
The On Track Survey is conducted in April-May and involves a short telephone survey of school leavers who attended school in the previous year and who agreed to participate in the survey. 
The On Track survey seeks to: 
Offer a consistent and comprehensive approach to monitoring the transitions of school leavers; 
Report the information to schools, TAFE institutions and other education providers, organisations concerned with assisting young people, policy makers, parents and students; 
Provide detailed analyses of the transitions experienced by different groups of leavers; 
Enable education providers to use the findings to monitor and improve their programs; and 
Provide a referral service for school leavers who appear to be experiencing difficulties in the transition process.  Results for individual schools are usually published in June of the survey year.

This dataset series contains polygon features delineating key Victorian administrative boundaries.  It comprises several data sets and is part of the Vicmap suite of products.
Datasets in the series are listed below.  See their individual metadata entries for more product specific metadata.

Local Government Area Boundaries - LGA_POLYGON (aligned to Property);
Local Government Area Boundaries - AD_LGA_AREA_POLYGON (aligned to Topo);

Locality Boundaries - LOCALITY_POLYGON (aligned to Property):
Locality Boundaries - AD_LOCALITY_AREA_POLYGON (aligned to Topo);

Postcode Boundaries - POSTCODE_POLYGON (aligned to Property);

Parish Boundaries - PARISH_POLYGON;

Township Boundaries - TOWNSHIP_POLYGON;

Victorian Lower House Electoral Boundaries 2022 - STATE_ASSEMBLY_2022;
Victorian Upper House Electoral Boundaries 2022  - STATE_COUNCIL_2022;

Ward Boundaries (Property) - WARD_2024;

Victorian Government Regional Departmental Boundaries - VICGOV_REGION (aligned to Property);
Victorian Government Regional Departmental Boundaries - AD_VICGOV_REGION (aligned to Topo);

Dept of  Environment, Land, Water and Planning - DELWP_REGION (aligned to Topo) - to be removed in November 2025;
Dept of  Energy, Environment and Climate Action - AD_DEECA_REGION (aligned to Topo);

Country Fire Authority (CFA) District Boundaries - CFA_DISTRICT;
Country Fire Authority (CFA) Region Boundaries - CFA_REGION;
Country Fire Authority (CFA) Total Fire Ban Districts - CFA_TFB_DISTRICT;

Fire Rescue Victoria Regions - FRV_REGION;
Fire Rescue Victoria Districts - FRV_DISTRICT;
Fire Rescue Victoria Response Area - FRV_RESPONSE_AREA;
Fire Rescue Victoria Legislated Boundary - FRV_LEGISLATED_BOUNDARY;

Emergency Management Victoria Regions - EMERGENCY_MANAGEMENT_REGION.
